    const [products, setProducts] = React.useState([])

    const data= [{
        id:1,
        tittle:"Producto"
    },{
    id:2,
    tittle:"Producto"
},]

    const handleRest = ()=>{
        if(count>0){
            setCount(count -1)
        }
    }

    React.useEffect(()=>{    
    console.log("Cada vez que la cuenta cambie, ejecuto")
    },[count, text])

    React.useEffect(()=>{
        setProducts(data)
    },[])

    const Button = ({texto}) =>{
        return (
            <span className="filtro-categorias">{texto}</span>
        )
    }
