    <>
    <div className="filtro-principal">
      <Button texto="Zapatillas" />
      <Button texto="Pantalones" />
      <Button texto="Remeras" />
      <Button texto="Abrigos" />
    </div>
    {text}
    <input type ="button" value="Clickeame" onClick={()=> setText("Texto una vez clickeado")}/>
    <input type="button" value="+" onClick={()=> setCount(count +1)}/>
    {count}
    <input type="button" value="-" onClick={handleRest}/>
    </>
    )
}
